      if (this.player1.isShooting && this.player1.shootingCooldown <= 0) {
        this.player1.bullets.push({
          x: this.player1.x + this.player1.size / 2,
          y: this.player1.y,
          dx: 0,
          dy: -10
        });
        this.player1.shootingCooldown = 30; // Cooldown frame count
