          if (item.type === 'speed') {
            this.player1.speed += 10;
          } else if (item.type === 'armor') {
            this.player2.armor += 1;
          }
          item.isCollected = true;
        }
      });
      this.items = this.items.filter(item => !item.isCollected);
    },
    isCollision(obj1, obj2) {
      return obj1.x < obj2.x + obj2.size && obj1.x + obj1.size > obj2.x && obj1.y < obj2.y + obj2.size && obj1.y + obj1.size > obj2.y;
    },
