          y: Math.random() * (this.canvas.height - this.itemSize),
          size: this.itemSize,
          type: this.itemTypes[Math.floor(Math.random() * this.itemTypes.length)]
        });
      }
    },
    drawItems() {
      this.items.forEach(item => {
        this.context.fillStyle = item.type === 'speed' ? 'green' : 'purple';
        this.context.fillRect(item.x, item.y, item.size, item.size);
      });
    },
    drawMaze() {
      this.context.fillStyle = 'grey';
      this.maze.forEach(obstacle => {
        this.context.fillRect(obstacle.x, obstacle.y, obstacle.width, obstacle.height);
      });
    },
